async function fetchDur(apikey, origin, destination){

  var origin = A;
  var destination = B;
  var proxyUrl = 'https://cors-anywhere.herokuapp.com/';
  var url = proxyUrl + 'https://maps.googleapis.com/maps/api/distancematrix/json?origins=' 
    + origin + '&destinations=' + destination + '&key=' + apikey;

  try{
    var r=JSON.parse(await fetch(url))
    alert(JSON.stringify(r.query));
    return {duration : r.rows[0].elements[0].duration.value};
  }catch(e){console.log(e);}
}

(async function(){
  var fetchData = await fetchDur(apikey, origin, destination);
